import { useEffect } from "react";
import { memo, FC } from "react";
import { useAllUsers } from "components/pages/bookfull";

export const MemberList: FC = memo(() => {
  const { getAllUsers, books } = useAllUsers(); // カスタムフック呼び出し

  useEffect(() => {
    getAllUsers(); // API取得
  }, []);

  return (
    <>
      // 表示
      {books.map((book) => (
        <>
          <p>{book.id}</p>
          <p>{book.title}</p>
          <p>{book.label}</p>
          <p>{book.name}</p>
        </>
      ))}
    </>
  );
});

export default MemberList;
